        consumerSecret: 'cs_3be3a3119ae882b4c3e67c74eadc285ed4a9d291',
        version: "wc/v2"
      });
      console.log(api);
    try {
      const result = await api.get("products", {
      per_page: 20, // 20 products per page
      })
